<!doctype html><html lang="en"><head>    <meta charset="UTF-8">    <meta name="viewport"          content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">    <meta http-equiv="X-UA-Compatible" content="ie=edge">    <link rel="stylesheet" href="Style.css">    <link rel="stylesheet" href="css/bootstrap.min.css">    <script src="https://kit.fontawesome.com/d4532539ca.js" crossorigin="anonymous"></script>    <script src="https://ajax.googleapis.com/ajax/libs/jquery/3.7.1/jquery.min.js"></script>    <script src="https://cdn.jsdelivr.net/npm/sweetalert2@11"></script>    <title>EnrolmentForm</title></head><body><main class="container shadow-sm p-3 d-flex flex-column gap-3 mt-5">    <div>      <a class="btn" href="./index.php">          <i class="fa-solid fa-reply-all text-success"></i>      </a>    </div>    <h3 class="fw-bold text-success">Enrollment Form  2024 </h3><div>    <label for="FirstName">FirstName</label>    <input class="form-control" type="text" id="FirstName" placeholder="Enter your FirstName"></div>    <div>        <label for="LastName">LastName</label>        <input class="form-control" type="text" id="LastName" placeholder="Enter your LastName">    </div>    <div>        <label for="Birthday">Birthday</label>        <input class="form-control" type="date" id="Birthday">    </div>    <div>        <label for="Address">CompleteAddress</label>        <input class="form-control" type="text" id="Address" placeholder="Enter Your CompleteAddress">    </div>    <div>        <label for="Profile">Profile</label>        <input class="form-control" type="file" id="Profile">    </div>    <div>        <select id="gender" class="form-select" aria-label="Default select example">            <option selected>Gender</option>            <option value="Male">Male</option>            <option value="Female">Female</option>        </select>    </div>    <div>        <select id="Year" class="form-select" aria-label="Default select example">            <option selected>Chose Year</option>            <option value="Fist Year">Fist Year</option>            <option value="Second Year">Second Year</option>            <option value="Third Year">Third Year</option>        </select>    </div>    <div>        <select id="Course" class="form-select" aria-label="Default select example">            <option selected>Select Your Strand or Course</option>            <option value="BSIT">BSIT</option>            <option value="BSOA">BSOA</option>            <option value="CSS">CSS</option>        </select>    </div>    <button id="submit" class="btn btn-success fw-bold" >Submit</button></main><script src="Main_JS/Collage.js"></script></body></html>